import axios from "axios";
import { useState } from "react";

export default function SignUp() {
  return (
    <div>
      <label>Name</label>
      <input type="text" />

      <label>Email</label>
      <input type="email" />

      <label>Phone</label>
      <input type="phone" />
    </div>
  );
}
